import React, { useEffect, useState } from "react";
import axios from "axios";

import 'hk-transport-display/src/component/MTR_Dict.js';

function MTR_trainInfo({ line, station }) {
  const [trainSchedule, setTrainSchedule] = useState({});
  var { mtrStnApi } = "";

  useEffect(() => {
    mtrStnApi = `https://rt.data.gov.hk/v1/transport/mtr/getSchedule.php?line=TCL&sta=SUN`;

    axios
      .get(mtrStnApi)
      .then((res) => setTrainSchedule(res.data.data))
      .catch((error) => console.log(error));

    console.log(trainSchedule);
  }, []);

  return <div className="mtr_traininfo">Hello</div>;
}

export default MTR_trainInfo;
